import React from 'react';
import { useState } from 'react';

import classes from './AddInterview.module.css';

const AddInterview = (props) => {
    const[num, setNum] = useState(0);

    const addInterviewHandler = () => {
        //event.preventDefault();
        setNum(num+1);
    };

    return (
        <div>
            <button className={classes.addInterviewButton} type="submit" onClick={addInterviewHandler}>Create Interview {num}</button>
        </div>
    );
};

export default AddInterview;
